import React from 'react'

import "./style.css"

const projectInfo = require("../projectInfo.json");

const TitleLinks = (props) => {
    const currentProject = projectInfo[props.projectName];
    return (
        <div className="titleDiv">
            <span id="title">{currentProject.title}</span>
            <div className="linkIcons text-center">
                {/* use props.github, props.deployed, etc. for a tag srcs */}
                
                <a href={currentProject.frontGithubLink} target="_blank" rel="noopener noreferrer">
                    <i class="fab fa-github"></i>                
                </a>
                
                <a href={currentProject.deployedProjectLink} target="_blank" rel="noopener noreferrer">
                    <i class="fas fa-external-link-alt"></i>
                </a>
            </div>
        </div>
    )
}

export default TitleLinks;
